import React from "react";
import MovieCard from "./components/MovieCard";

// ðŸ‘‡ 3 sample movie objects
const movies = [
  {
    title: "Avengers: Endgame",
    posterUrl: "https://image.tmdb.org/t/p/w500/8UlWHLMpgZm9bx6QYh0NFoq67TZ.jpg",
    previewUrl: "https://www.w3schools.com/html/mov_bbb.mp4",
  },
  {
    title: "Iron Man",
    posterUrl: "https://image.tmdb.org/t/p/w500/5bgz5vUlfU3TuBCAB0yHnHK1jsO.jpg",
    previewUrl: "https://www.w3schools.com/html/mov_bbb.mp4",
  },
  {
    title: "Doctor Strange",
    posterUrl: "https://image.tmdb.org/t/p/w500/titf4RkZ4YJUKT8zOMhZyyXGOMp.jpg",
    previewUrl: "https://www.w3schools.com/html/mov_bbb.mp4",
  },
];

const App = () => {
  return (
    <div
      style={{
        display: "flex",
        flexWrap: "wrap",
        justifyContent: "center",
        gap: "1.5rem",
        padding: "2rem",
      }}
    >
      {movies.map((movie, index) => (
        <MovieCard key={index} movie={movie} />
      ))}
    </div>
  );
};

export default App;
